import React , { useState }from 'react';
import './LandingPage.css';
import { Link } from 'react-router-dom';
import WeatherApi from './weather_api.js';
import GoogleTranslate from './Translate.js';


function LandingPage() {
    const [isHighContrast, setIsHighContrast] = useState(false);

    return (
        <div className='LandingPage'>

            <img src={'banner.png'} alt="New seasonal item banner of the Hello Kitty Crush drink at Tiger Sugar"/>

            <Link to="/order">
                <button alt="Order button">Order Here</button>
            </Link>

            <Link to="/menu">
                <button alt="Menu button">Menu</button>
            </Link>

            {/* move it wherever necessary */}
            <button onClick={() => setIsHighContrast(!isHighContrast)}>
                Toggle High Contrast
            </button>

            {/* translate called */}
            <GoogleTranslate /> 

            {/* weather called */}
            <h1>Weather</h1>
            <WeatherApi />

        </div>
    );
}


export default LandingPage;
